import "./Card.css";

function Card(props) {
  return (
    <div className="card-container">
      <div className="icon-container"></div>
      <div className="card-title">
        <h3> CARD TITLE </h3>
      </div>
      <div className="card-body">
        <p>
          Lorem ipsum dolor, sit amet consectetur adipisicing elit. A rerum,
          corporis expedita fugiat omnis perspiciatis quidem, quod quibusdam
          tempore odit aliquid libero ea ipsam earum iste? Voluptates repellat
          qui aliquid.
        </p>
      </div>
    </div>
  );
}

export default Card;
